INSERT INTO `magazine_list` (`id`, `magazineId`, `issueNumber`, `title`, `author`, `imgUrl`, `summary`, `pageUrl`, `authorLink`, `category`, `categoryLink`, `lastEdited`, `releaseDate`) VALUES
(1, 1, 1, 'Petunjuk Pengguna iPhone untuk iOS 10.2', 'Apple Inc.', 'http://is2.mzstatic.com/image/thumb/Publication122/v4/41/cb/ad/41cbad02-218b-66f2-70b1-355dae660b26/ePubCoveriPhone.png/170x170bb-85.jpg', 'Berikut segala hal yang perlu Anda ketahui tentang iPhone, dalam format digital yang ringkas. Kenali iPhone dan temukan semua hal yang menakjubkan yang dapat dilakukan iPhone, dan bagaimana melakukannya. Ini adalah panduan definitif untuk memaksimalkan iPhone baru Anda, langsung dari Apple. Petunjuk Pengguna iPhone adalah bagian penting dari perpustakaan iBooks.', 'https://itunes.apple.com/id/book/petunjuk-pengguna-iphone-untuk/id1154775546?mt=11&uo=2', 'https://itunes.apple.com/id/author/apple-inc./id405307759?mt=11&uo=2', 'Computers', 'https://itunes.apple.com/id/genre/books-computers/id10017?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(2, 2, 1, 'The Art of War', 'Sun Tzu', 'http://is4.mzstatic.com/image/thumb/Publication7/v4/bf/88/1e/bf881e7e-8229-90fb-538e-8e27f22d1e6c/coverArt.6f3050.jpg/170x170bb-85.jpg', 'It has been the most famous and influential of China''s&#xa0;Seven Military Classics, and "for the last two thousand years it remained the most important military treatise in Asia, where even the common people knew it by name. It has had an influence on Eastern and Western military thinking, business tactics, legal strategy and beyond.', 'https://itunes.apple.com/id/book/the-art-of-war/id395534623?mt=11&uo=2', 'https://itunes.apple.com/id/author/sun-tzu/id60737826?mt=11&uo=2', 'Military', 'https://itunes.apple.com/id/genre/books-history-military/id10078?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(3, 2, 2, 'The Adventures of Sherlock Holmes', 'Arthur Conan Doyle', 'http://is5.mzstatic.com/image/thumb/Publication3/v4/98/ee/a9/98eea9c9-495d-d214-8356-30e0d1d2a721/cover.png/170x170bb-85.jpg', 'The Adventures of Sherlock Holmes is a compilation of twelve short Sherlock Holmes detective stories.', 'https://itunes.apple.com/id/book/adventures-sherlock-holmes/id395536306?mt=11&uo=2', 'https://itunes.apple.com/id/author/arthur-conan-doyle/id2023824?mt=11&uo=2', 'Mysteries & Thrillers', 'https://itunes.apple.com/id/genre/books-crime-thrillers/id9032?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(4, 2, 3, 'Cinderella', 'Richard Harding Davis', 'http://is5.mzstatic.com/image/thumb/Publication1/v4/9e/91/b7/9e91b72d-d5e8-74b5-995b-e30850748e83/coverArt.3c700e.jpg/170x170bb-85.jpg', 'This 1896 collection of stories for young readers features the title story — updating the fairy tale to New York City during the Gilded Age. It also includes Miss Delamar’s Understudy, The Editor’s Story, An Assisted Emigrant, and The Reporter Who Made Himself King.', 'https://itunes.apple.com/id/book/cinderella/id510322135?mt=11&uo=2', 'https://itunes.apple.com/id/author/richard-harding-davis/id365984705?mt=11&uo=2', 'Fiction & Literature', 'https://itunes.apple.com/id/genre/books-fiction-literature/id9031?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(5, 2, 4, 'Dream Psychology', 'Sigmund Freud', 'http://is3.mzstatic.com/image/thumb/Publication7/v4/87/45/29/874529bc-fd4a-2340-b33d-af27edb16465/coverArt.397acd.jpg/170x170bb-85.jpg', 'The medical profession is justly conservative. Human life should not be considered as the proper material for wild experiments. Conservatism, however, is too often a welcome excuse for lazy minds, loath to adapt themselves to fast changing conditions. Remember the scornful reception which first was accorded to Freud''s discoveries in the domain of the unconscious.', 'https://itunes.apple.com/id/book/dream-psychology/id395687522?mt=11&uo=2', 'https://itunes.apple.com/id/author/sigmund-freud/id122049187?mt=11&uo=2', 'Psychology', 'https://itunes.apple.com/id/genre/books-psychology/id10094?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(6, 1, 2, 'Petunjuk Pengguna iPad untuk iOS 10.2', 'Apple Inc.', 'http://is3.mzstatic.com/image/thumb/Publication42/v4/a1/45/ca/a145ca23-017e-968e-7b3b-9b454c78379d/ePubCoveriPad.png/170x170bb-85.jpg', 'Ini semua yang perlu Anda ketahui mengenai iPad, dengan format digital yang praktis. Mengenal iPad dan menemukan semua hal menakjubkan yang dapat dilakukan iPad, dan cara menggunakannya. Ini adalah panduan definitif untuk menggunakan iPad baru Anda dengan maksimal, langsung dari Apple. Petunjuk Pengguna iPad adalah bagian penting dari segala perpustakaan iBooks.', 'https://itunes.apple.com/id/book/petunjuk-pengguna-ipad-untuk/id1158139542?mt=11&uo=2', 'https://itunes.apple.com/id/author/apple-inc./id405307759?mt=11&uo=2', 'Computers', 'https://itunes.apple.com/id/genre/books-computers/id10017?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(7, 3, 1, 'Love, Life & Work', 'Elbert Hubbard', 'http://is4.mzstatic.com/image/thumb/Publication7/v4/0f/07/11/0f0711d2-a1ab-4508-0af5-771ac56e7bca/coverArt.ba277a.jpg/170x170bb-85.jpg', 'Every religion is made up of two elements that never mix any more than oil and water mix J A religion is a mechanical mixture, not a chemical combination, of morality and dogma. Dogma is the science of the unseen: the doctrine of the unknown and unknowable. And in order to give this science plausibiUty, its promulgators have always fastened upon it moraUty. Morality can and does exist entirely separate and apart from dogma, but dogma is ever a parasite on morality, and the business of the priest is to confuse the two. But morality and religion never saponify. Morality is simply the question of expressing your Ufe forces — how to use them ? You have so much energy ; and what will you do with it ? And from out the multitude there have always been men to step forward and give you advice for a consideration. Without their supposed influence with the unseen we might not accept their interpretation of what is right and wrong. But with the assurance that their advice is backed up by Deity, followed with an offer of reward if we believe it, and a threat of dire punishment if we do not, the Self-appointed Superior Class has driven men wheresoever it', 'https://itunes.apple.com/id/book/love-life-work/id505912520?mt=11&uo=2', 'https://itunes.apple.com/id/author/elbert-hubbard/id287376075?mt=11&uo=2', 'Short Stories', 'https://itunes.apple.com/id/genre/books-short-stories/id10065?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(8, 1, 3, 'iPhone User Guide for iOS 10.2', 'Apple Inc.', 'http://is4.mzstatic.com/image/thumb/Publication62/v4/00/b1/b1/00b1b137-a2be-76e7-5b1e-55bdcda8232e/ePubCoveriPhone.png/170x170bb-85.jpg', 'Here&#39;s everything you need to know about iPhone, in a handy digital format. Get to know iPhone and discover all the amazing things it can do, and how to do them. It&#39;s the definitive guide for getting the most from your new iPhone, straight from Apple. The iPhone User Guide is an essential part of any iBooks library.', 'https://itunes.apple.com/id/book/iphone-user-guide-for-ios-10.2/id1134772174?mt=11&uo=2', 'https://itunes.apple.com/id/author/apple-inc./id405307759?mt=11&uo=2', 'Computers', 'https://itunes.apple.com/id/genre/books-computers/id10017?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(9, 3, 2, 'Romeo & Juliet', 'William Shakespeare', 'http://is1.mzstatic.com/image/thumb/Publication1/v4/0f/d8/34/0fd834e4-1bc3-db75-c70e-1fcfedf57f4d/cover.png/170x170bb-85.jpg', 'The doomed romance between two young people whose families are bitter enemies.', 'https://itunes.apple.com/id/book/romeo-juliet/id916363784?mt=11&uo=2', 'https://itunes.apple.com/id/author/william-shakespeare/id2765976?mt=11&uo=2', 'Theater', 'https://itunes.apple.com/id/genre/books-theatre/id10036?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(10, 3, 3, 'The Future of Islam', 'Wilfred Scawen Blunt', 'http://is4.mzstatic.com/image/thumb/Publication7/v4/d3/d2/23/d3d22364-d084-1510-8e41-94fcace10c0f/coverArt.735783.jpg/170x170bb-85.jpg', 'It was the first coherent study of ''modern'' Islam, explaining in a simple and functional manner its tenets and roots, the diversity of its cultural and political experience, and its dynamism and potential for good in the modern world. This was at a time when the Muslim world was perceived by most people in the west as inert and spent, caught in an irredeemable malaise of its own making. Blunt''s attitude, shaped by several factors and sharpened by personal knowledge of important parts of the Muslim world and close association with many leading reformers in it, was unprecedented and startling at the time.', 'https://itunes.apple.com/id/book/the-future-of-islam/id510335977?mt=11&uo=2', 'https://itunes.apple.com/id/author/wilfred-scawen-blunt/id474057760?mt=11&uo=2', 'Islam', 'https://itunes.apple.com/id/genre/books-islam/id10109?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(11, 3, 4, 'The History of Sumatra', 'William Marsden', 'http://is3.mzstatic.com/image/thumb/Publication7/v4/8d/ea/32/8dea32e6-062d-3bc1-b5ff-49eb6bd79523/coverArt.ae42a3.jpg/170x170bb-85.jpg', 'This is an adventure book. Sumatra (Indonesian: Sumatera) is an island in western Indonesia and part of the Sunda Islands. It is the largest island that is entirely in Indonesia (two larger islands, Borneo and New Guinea, are shared between Indonesia and other countries) and the sixth largest island in the world at 480,847.74 km2 (including adjacent islands such as the Riau Islands and Bangga Belitung Islands), with a current population of over 50 million (54 million administratively, as Riau Islands and Bangka–Belitung Islands are included). Its biggest city is Medan which has over 4,300,000 people in its metropolitan area. Sumatra is an elongated landmass spanning a diagonal northwest-southeast axis. The Indian Ocean borders the west, northwest, and southwest sides of Sumatra with the island chain of Simeulue, Nias and Mentawai bordering the southwestern coast. On the northeast side the narrow Strait of Malacca separates the island from the Malay Peninsula, an extension of the Eurasian continent. On the southeast the narrow Sunda Strait separates Sumatra from Java.', 'https://itunes.apple.com/id/book/the-history-of-sumatra/id510335213?mt=11&uo=2', 'https://itunes.apple.com/id/author/william-marsden/id366198056?mt=11&uo=2', 'Adventure', 'https://itunes.apple.com/id/genre/books-adventure/id11006?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(12, 1, 4, 'Petunjuk Pengguna iPhone untuk iOS 9.3', 'Apple Inc.', 'http://is3.mzstatic.com/image/thumb/Publication62/v4/c9/cf/dd/c9cfddf7-a375-4cf4-7da7-498a5f5b3752/mzm.lrzfjanm.png/170x170bb-85.jpg', 'Ini semua yang perlu Anda ketahui mengenai iPhone, dalam format digital yang praktis. Mengenal iPhone dan menemukan semua hal menakjubkan yang dapat dilakukannya, serta cara melakukannya. Petunjuk yang definitif untuk mendapatkan yang terbaik dari iPhone baru Anda, langsung dari Apple. Petunjuk Pengguna iPhone adalah bagian penting dari segala perpustakaan iBooks.', 'https://itunes.apple.com/id/book/petunjuk-pengguna-iphone-untuk/id1041616155?mt=11&uo=2', 'https://itunes.apple.com/id/author/apple-inc./id405307759?mt=11&uo=2', 'Computers', 'https://itunes.apple.com/id/genre/books-computers/id10017?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(13, 3, 5, 'The Madman', 'Khalil Gibran', 'http://is5.mzstatic.com/image/thumb/Publication1/v4/bf/5a/7f/bf5a7fbe-129c-73ac-0547-2d32f162a068/coverArt.e22c34.jpg/170x170bb-85.jpg', 'Thought-provoking collection of life-affirming parables and poems by the author , casting an ironic light on the beliefs, aspirations, and vanities of humankind.', 'https://itunes.apple.com/id/book/the-madman/id501014750?mt=11&uo=2', 'https://itunes.apple.com/id/author/khalil-gibran/id25596840?mt=11&uo=2', 'Poetry', 'https://itunes.apple.com/id/genre/books-poetry/id10093?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(14, 3, 6, 'Falling in Love', 'Grant Allen', 'http://is5.mzstatic.com/image/thumb/Publication7/v4/27/89/96/278996f8-7f67-8e01-895d-26f2a981f42c/coverArt.315a0e.jpg/170x170bb-85.jpg', 'The book as modern biology teaches us to believe, is nothing more than the latest, highest, and most involved exemplification, in the human race, of that almost universal selective process. In our own species, the selective process is marked by all the features common to selection throughout the whole animal kingdom; but it is also, as might be expected, far more specialized, far more individualized, far more cognizant of personal traits and minor peculiarities. What we all fall in love with, then, as a race, is in most cases efficiency and ability.', 'https://itunes.apple.com/id/book/falling-in-love/id510929333?mt=11&uo=2', 'https://itunes.apple.com/id/author/grant-allen/id366147333?mt=11&uo=2', 'Fiction & Literature', 'https://itunes.apple.com/id/genre/books-fiction-literature/id9031?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(15, 3, 7, 'A Lover''s Complaint', 'William Shakespeare', 'http://is1.mzstatic.com/image/thumb/Publication7/v4/47/4d/0c/474d0c15-92a5-6595-4f39-b323a486a92d/coverArt.e77163.jpg/170x170bb-85.jpg', 'In the poem, the speaker sees a young woman weeping at the edge of a river, into which she throws torn-up letters, rings, and other tokens of love. An old man asks the reason for her sorrow, and she responds by telling him of a former lover who pursued, seduced, and finally abandoned her. She concludes her story by conceding that she would fall for the young man''s false charms again.', 'https://itunes.apple.com/id/book/a-lovers-complaint/id498662218?mt=11&uo=2', 'https://itunes.apple.com/id/author/william-shakespeare/id2765976?mt=11&uo=2', 'Poetry', 'https://itunes.apple.com/id/genre/books-poetry/id10093?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(16, 3, 8, 'The Republic', 'Plato', 'http://is5.mzstatic.com/image/thumb/Publication5/v4/32/c0/fb/32c0fbfb-2d35-b8da-2591-c8b23b1717ed/coverArt.a4b98d.jpg/170x170bb-85.jpg', 'The Republic&#xa0; is a&#xa0;Socratic dialogue, written by&#xa0;Plato&#xa0;around 380 BC, concerning the definition of&#xa0;justice&#xa0;, the order and character of the just&#xa0;city-state&#xa0;and the just man.', 'https://itunes.apple.com/id/book/the-republic/id395535342?mt=11&uo=2', 'https://itunes.apple.com/id/author/plato/id361618116?mt=11&uo=2', 'Philosophy', 'https://itunes.apple.com/id/genre/books-non-fiction-philosophy/id10091?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(17, 3, 9, 'Poems', 'Emily Dickinson', 'http://is4.mzstatic.com/image/thumb/Publication1/v4/ce/e5/bf/cee5bf49-65db-89a4-00ba-37b4139a8cd1/coverArt.6e26e7.jpg/170x170bb-85.jpg', '', 'https://itunes.apple.com/id/book/poems/id395539873?mt=11&uo=2', 'https://itunes.apple.com/id/author/emily-dickinson/id275050544?mt=11&uo=2', 'Poetry', 'https://itunes.apple.com/id/genre/books-poetry/id10093?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(18, 3, 10, 'Alice''s Adventures in Wonderland', 'Lewis Carroll', 'http://is1.mzstatic.com/image/thumb/Publication1/v4/f7/2f/1e/f72f1e1d-4f82-5d68-f575-75fa2989fce4/coverArt.8f3189.jpg/170x170bb-85.jpg', 'The book story of a girl named Alice who falls down a rabbit hole into a fantasy world populated by peculiar and anthropomorphic creatures.', 'https://itunes.apple.com/id/book/alices-adventures-in-wonderland/id510986661?mt=11&uo=2', 'https://itunes.apple.com/id/author/lewis-carroll/id2683818?mt=11&uo=2', 'Action & Adventure', 'https://itunes.apple.com/id/genre/books-action-adventure/id10039?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(19, 1, 5, 'iPad User Guide for iOS 10.2', 'Apple Inc.', 'http://is3.mzstatic.com/image/thumb/Publication71/v4/bb/f4/5b/bbf45b7c-bdb2-6a82-d29f-97ddf6437241/ePubCoveriPad.png/170x170bb-85.jpg', 'Here&#39;s everything you need to know about iPad, in a handy digital format. Get to know iPad and discover all the amazing things it can do, and how to do them. It&#39;s the definitive guide for getting the most from your new iPad, straight from Apple. The iPad User Guide is an essential part of any iBooks library.', 'https://itunes.apple.com/id/book/ipad-user-guide-for-ios-10.2/id1134772572?mt=11&uo=2', 'https://itunes.apple.com/id/author/apple-inc./id405307759?mt=11&uo=2', 'Computers', 'https://itunes.apple.com/id/genre/books-computers/id10017?mt=11&uo=2', '0000-00-00 00:00:00', ''),
(20, 3, 11, 'The Return of Sherlock Holmes', 'Arthur Conan Doyle', 'http://is2.mzstatic.com/image/thumb/Publication4/v4/59/34/5c/59345caf-40d0-80ad-280c-eebdb2d1318a/cover.png/170x170bb-85.jpg', 'Once again Mr Sherlock Holmes is free to devote his life to examining those interesting little problems which the complex life of London so plentifully presents''. Evil masterminds beware! Sherlock Holmes is back! Ten years after his supposed death in the swirling torrent of the Reichenbach Falls locked in the arms of his arch enemy Professor Moriarty, Arthur Conan Doyle agreed to pen further adventures featuring his brilliant detective. In the first story, ''The Empty House'', Holmes returns to Baker Street and his good friend Watson, explaining how he escaped from his watery grave. In creating this collection of tales, Doyle had lost none of his cunning or panache, providing Holmes with a sparkling set of mysteries to solve and a challenging set of adversaries to defeat. The potent mixture includes murder, abduction, baffling cryptograms and robbery. We are also introduced to the one of the cruellest villains in the Holmes canon, the despicable Charles Augustus Milverton. As before, Watson is the superb narrator and the magic remains unchanged and undimmed.', 'https://itunes.apple.com/id/book/the-return-of-sherlock-holmes/id496782692?mt=11&uo=2', 'https://itunes.apple.com/id/author/arthur-conan-doyle/id2023824?mt=11&uo=2', 'Mysteries & Thrillers', 'https://itunes.apple.com/id/genre/books-crime-thrillers/id9032?mt=11&uo=2', '0000-00-00 00:00:00', '');
